import React from 'react'
import styled from 'styled-components'
import {BigBlackButton} from './BigBlackButton'
import {Button} from 'antd'

const Container = styled.div`
    border-top: 1px solid #DAE2EF;
    width: 100%;
    padding-bottom: 46px;
    padding-top: 46px;
    padding-right: 66px;
    padding-left: 66px;
    flex-direction: row;
    justify-content: flex-end;
    display: flex;
`

interface BackNextProps {
    backClick: () => void
    nextClick: () => void
}

const BackNext: React.FC<BackNextProps> = (props) => {
    const {backClick, nextClick} = props

    return (
        <Container>
            <Button onClick={backClick} type={'link'}>Back</Button>
            <BigBlackButton onClick={nextClick}>Next</BigBlackButton>
        </Container>
    )
}

export default BackNext
